import React from 'react';
import { View, TouchableOpacity, Text } from 'react-native';
import StyleButtonList from './StyleButtonLIst';
import SavedmessagePage from '../../../../SavedMessagePage/SavedMessagePage';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

const Stack = createStackNavigator();

const ButtonList = () => {
    let items: string[] =["Saved message","Look","Notification","Chat folders","Confidentiality","Language",];
    return <View>
    {items.map((item, index) => (
      <View key={index} >
        <TouchableOpacity style={StyleButtonList.button}>
          <Text>{item}</Text>
        </TouchableOpacity>
      </View>
    ))}
  </View>
}

function bgtton({navigation}:{navigation:any}){
  return <View>
        <Text>Home Screen</Text>
          <TouchableOpacity
        onPress={() => navigation.navigate('SavedmessagePage')}
      ><Text>123</Text></TouchableOpacity>
    </View>
}

export default ButtonList;
